import React from "react";
import Card from "../UI/Card";

const Users = props => {
 return (
    <Card>
    <ul>{props.item.map(item => <li key = {item.id}>{item.name} ({item.age} years old)</li>)}</ul>
    </Card>
 );
};

export default Users;
